  const[value,setValue]=useState("")



    return (
      (!value)?<Login setValue={setValue}  />:
      <div>

        <button onClick={()=>localStorage.clear()}> Logout </button>
        <Link to="/create">Create invoice</Link>
        <Link to="/search">Search invoice</Link>
      </div>
    );

}

